import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React, {Component} from 'react';

const left_nav_items = [
    {id: "home", title: "Hem"},
    {id: "events", title: "Events"},
    {id: "km", title: "Klubbmästeriet"},
    {id: "contact", title: "Kontakt"},
];

const right_nav_items = [
    {id: "login", title: "Logga in"},
];

class Navbar extends Component {

    constructor(props){
        super(props);
        this.onSelect = (props.onSelect === undefined) ? (id) => console.log("Navigation selected", id) : props.onSelect;
    }

    render(){
        this.content_left = left_nav_items.map((item) => {
            return (
                <Nav.Item key={"nav_"+item.id}>
                    <Nav.Link onSelect={() => this.onSelect(item.id)} href={"#"+item.id}> {item.title} </Nav.Link>
                </Nav.Item>
            )
        });

        this.content_right = right_nav_items.map((item) => {
            return (
                <Nav.Item key={"nav_"+item.id}>
                    <Nav.Link onSelect={() => this.onSelect(item.id)} href={"#"+item.id}> {item.title} </Nav.Link>
                </Nav.Item>
            )
        });

        return (
            <Nav className={"clearfix"}>
                <div className={"left"}>
                    {this.content_left}
                </div>

                <div className={"right"}>
                    {this.content_right}
                </div>
            </Nav>
        )
    }
}

export default Navbar;
